const fs = require('fs')

class helpers {
    static getPlaylistUrl(playlistId) {
        return "https://api.spotify.com/v1/playlists/" + playlistId;
    }
    
    static formatTrack(trackId) {
        const track = `spotify:track:${trackId}`;
        return track;
    }

    static async saveDb(playlist) {
        try{
            const db = await helpers.getDb();    
            const saved = {...db, playlistId:playlist.id, tracks:playlist.tracks} 
            fs.writeFileSync('server/db.json', JSON.stringify(saved));
        }
        catch(error){
            console.log(error);
        }
    }

    static async getDb() {
        try{
            const db = await fs.readFileSync('server/db.json', "utf-8");
            return JSON.parse(db)
        }
        catch(error) { 
            console.log(error);
        }
    }
    
    static getCover() {
        return "";
    }
}

module.exports = helpers;
